import "../style/DropDown.scss";

function DropDown() {
  return (
    <div className="dropDown">
      <a onClick={() => history.push("/userHome")}>User Home</a>
      <a href="#">Preferences</a>
      <a href="#">Logout</a>
    </div>
  );
}

export default DropDown;
